import React, { Component } from "react";
    class InputForm extends Component{
        constructor(props) {
            super(props);
            this.input = React.createRef();
            this.focusTextInput = this.focusTextInput.bind(this);
        }
        render() {
            return (
                <div>
                    <input 
                        type="text" 
                        ref={this.input} 
                        placeholder="enter task"/>
                    <input 
                        type="submit" 
                        value="Add" />
                </div>
            )
        }
    }



export default InputForm;
